insert into service_provider (id, name, abbr, title, abstracts, fees, access_constraints, given_name, url, updated_date, wms_version) values (167, 'OGC:WMS', 'demo', 'Kaartenbalie', 'Controlled access to OGC WMS maps. See B3P GIS at http://www.b3partners.nl/', 'none', 'none', 'B3p Public', 'http://x5.b3p.nl/cgi-bin/mapserv_fwtools?map=/srv/maps/kaartenbalie.map&', timestamp'2010-04-26 09:28:45', '1.1.1');
insert into service_provider (id, name, abbr, title, abstracts, fees, access_constraints, given_name, url, updated_date, wms_version) values (174, 'WMS', 'ntr', 'Natura2000', 'Natura 2000-gebieden per 11 september 2008 (Habitatrichtlijnengenbieden, vogelrichtlijngebieden, nbwet gebieden). De Europese Unie heeft een zeer gevarieerde en rijke natuur, die van grote biologische, esthetische en economische waarde is. Om deze natuur te behouden heeft de Europese Unie het initiatief genomen voor Natura 2000. Dit is een samenhangend netwerk van beschermde natuurgebieden. Voor Nederland gaat het in totaal om 162 gebieden. Deze Natura 2000-gebieden wijst Nederland op dit moment aan. In 2007 hebben de ontwerpbesluiten van de eerste 111 Natura 2000-gebieden (tranche 1) en de ontwerpbesluiten van de 7 Natura 2000-gebieden in het waddengebied (tranche 2) ter inzage gelegen. Tussen 11 september tot en met 22 okt 2008 liggen de ontwerp-aanwijzingsbesluiten voor de volgende 29 gebieden ter inzage (tranche 3). Dit bestand geeft de grenzen van de tranche 1, 2 en 3 gebieden aan op de peildatum 11 september 2008. Voor de overige 15 gebieden, tranche 4, bevat deze dataset de grenzen van 2003 als het om habitatrichtlijngebieden gaat en de grenzen van 2005 als het om vogelrichtlijngebieden gaat. De minister heeft op 19 februari 2008 de eerste drie gebieden definitief aangewezen: Voornes Duin, Duinen Goeree &amp; Kwade Hoek en Voordelta. Voor deze gebieden is de buitengrens op basis van de kadastergrens opgenomen.', '-', '-', 'Natura', 'http://gisserver1.agro.nl/arcgis/services/Natura2000/MapServer/WMSServer', timestamp'2010-04-26 09:29:41', '1.1.1');
insert into service_provider (id, name, abbr, title, abstracts, fees, access_constraints, given_name, url, updated_date, wms_version) values (178, 'OGC:WMS', 'osm', 'OpenStreetMap', 'Controlled access to OGC WMS maps. See B3P GIS at http://www.b3partners.nl/', 'none', 'none', 'OpenStreetMap', 'http://osm.kaartenbalie.nl/wms/mapserver?', timestamp'2010-04-26 09:36:44', '1.1.1');
insert into service_provider (id, name, abbr, title, abstracts, fees, access_constraints, given_name, url, updated_date, wms_version) values (189, 'OGC:WMS', 'roo', 'RO-Online: De landelijke voorziening voor digitale ruimtelijke ordeningsplannen', 'Digitale ruimtelijke plannen die verplicht beschikbaar worden gesteld a.g.v. digitale aspecten van de nieuwe Wet ruimtelijke ordening (per 1/1/2010) en vrijwillig beschikbaar gesteld oudere plannen.', 'none', 'none', 'RO-Online', 'http://afnemers.ruimtelijkeplannen.nl:80/afnemers/services?', timestamp'2010-04-26 09:38:54', '1.1.1');
